import CartAmount from "./CartAmount";
import wishlistIcon from "../Assets/wishlist.svg";
import gift from "../Assets/newsletterGift.png";

const Cart = () => {
return (
<div>
    <div>
    <CartAmount />
    <button>Warenkorb</button>
    </div>
    <div>
    <img src={wishlistIcon} width="20" alt="Wish List Icon" /> Auf den Wunschzettel
    </div>
    <div><img src={gift} alt="Newsletter Gift" /></div>
</div>
);

}

export default Cart;
